import React from "react";

const Main = () => (
<div class="main">
<iframe class="mains" src="https://www.youthcenter.go.kr/youngPlcyUnif/youngPlcyUnifList.do"/>
<div class="lnb">
<div id='dis'><h1>여기에 있는 글이 버튼을 누르면 보여지고 사라집니다.</h1></div>
<button id='show' onclick="dis()">show</button>
<script>

      if($('#dis').css('display') == 'none'){
      $('#dis').show()
    }else{
      $('#dis').hide()
    }
    
</script>
  <button></button>
    <ul class="card">
      <iframe class="real_chatbot" src="https://stage.coginsight.net/service/#/e1209138-2a2b-4e0d-9d38-a6eafa3dccb7"></iframe>
    </ul>
  
</div>
</div>
)

export default Main;
